import React from 'react'
import './header.css'
import Logo from './logo192.png'
const nav__links = [
    {
        path: '#home',
        display: 'Home'
    },
    {
        path: '#about',
        display: 'About Us'
    },
    {
        path: '#services',
        display: 'Services'
    },
    {
        path: '#projects',
        display: 'Projects'
    },
    {
        path: '#contact',
        display: 'Contact Us'
    }
]


export const Header = () => {
  return (
    <header className="header">
        <div className="container">
            <div className="nav__wrapper">
                <div className="logo">

                    <h2>AutoAlpha</h2>
                </div>

                {/*  ============navigation =========== */}
                <div className="navigation">
                <ul className="menu">
                    {
                        nav__links.map((item,index) => (
                            <li className="menu__item">
                                <a href={item.path} className="menu__link">
                                    {item.display}
                                </a>
                            </li>
                        ))
                    }
                </ul>
                </div>

                { /* ========= light mode ========== |*/}
                <div className="light__mode">
                    <span>
                    <i class="ri-lightbulb-fill"></i>
                    Light Mode
                    </span>
                </div>
            </div>
        </div>
    </header>
  )
}
